# Import Libraries
"""

import random
import math
import copy
from IPython.display import clear_output

"""# Generate Population"""

def generatePopulasi(nPop, nKrom):
    population = [[int(random.choice([1,0])) for i in range(nKrom)] for j in range(nPop)] # generate list 2 dimensi
    
    return population

"""# Decode Chromosome"""

# MENGUBAH BINARY KROMOSOM MENJADI NILAI REAL BERUPA X1, X2
def decode(krom):  
  x1min = -1
  x1max = 2
  x2min = -1
  x2max = 1
  
  lmid = round(len(krom)/2)
  x1 = krom[:lmid]
  x2 = krom[lmid:]

  dec1 = x1min + (((x1max - x1min)/ sum([2**(-(i+1)) for i in range(len(x1))])) * sum([(x1[j]*(2**(-(j+1)))) for j in range(len(x1))])) 
  dec2 = x2min + (((x2max - x2min)/ sum([2**(-(i+1)) for i in range(len(x2))])) * sum([(x2[j]*(2**(-(j+1)))) for j in range(len(x2))]))

  return dec1, dec2

"""# Fitness"""

def fx(x1, x2):
  return ((math.cos(x1)*math.sin(x2))-(x1/(x2**2+1))) # FUNGSI H

def calcFitness(population):
    fitness = []
    a = 1
    for i in population:
        x1,x2=decode(i)
        h = fx(x1,x2)
        if h >= 0:
          fitness.append(1/(h+a)) 
        elif h < 0:
          fitness.append(-h)
    return fitness

"""# Elitisme"""

# MENYIMPAN 5 KROMOSOM DENGAN NILAI FITNESS TERTINGGI
def elitism(pop, fit):
  rank = sorted(zip(pop, fit), key=lambda x:x[1], reverse=True)
  elitisme = []
  for i in range(5):
    elitisme.append(rank[i][0])
  return elitisme

"""# Parent Selection
## Tournament Selection
"""

# MENGAMBIL SAMPLE INDIVIDU SEBANYAK k  UNTUK DIJADIKAN KANDIDAT TOURNAMENT
def tournament(populasi, k):

  candidate = random.sample(populasi, k)
  fit = calcFitness(candidate)
  elite = elitism(candidate, fit)
  result = elite[0]
  return result

"""# Crossover"""

# MELAKUKAN KAWIN SILANG DENGAN METODE SINGLE POINT
def crossover(parent1, parent2, prob):
  if random.random() <= prob:
    
    tipot = random.choice(range(1,len(parent1)-1))
    temp = parent1[tipot:]
    parent1[tipot:] = parent2[tipot:]
    parent2[tipot:] = temp

  return parent1, parent2

"""# Mutation"""

# MELAKUKAN MUTASI PADA SETIAP INDIVIDU DALAM KROMOSOM
def mutasi(krom,prob):
  for i in range(len(krom)):
    if random.random() <= prob:
      if krom[i] == 1:
        krom[i] = 0
      elif krom[i] == 0:
        krom[i] = 1
  return krom

"""# Konvergen check"""

# MENGECEK APAKAH NILAI FITNESS SETIAP GENERASI SAMA ATAU TIDAK
# FUNGSI INI AKAN MENGHASILKAN INTEGER "count" UNTUK DICEK PADA MAIN PROGRAM

def cek_konvergen(fitness):
  rank = fitness[0]
  count = 0
  for i in range(1, len(fitness)):
    if rank == fitness[i]:
      count+=1

  return count

"""# Variable Global"""

n_population  = 50 # jumlah populasi
probMutasi = 0.01 # probabilitas mutasi = ~1%
probCrossover = 0.7 # probabilitas crossover = 60% - 70%
max_gen = 500 # maksimal generasi yang akan dibangun
indv = 50 # jumlah individu
k_prob = 5 # k value untuk tournament selection

"""# Main Program"""

# GENERATE POPULASI
populasi = generatePopulasi(n_population, indv)

# LOOPING SEBANYAK MAKSIMAL GENERASI
for generasi in range(max_gen):

  # KALKULASI FITNESS
  n_fitness = calcFitness(populasi)

  # CEK KONVERGEN 
  ck = cek_konvergen(n_fitness)
  if ck == len(n_fitness)-1 :
    break
  # ELITISME
  newpop = elitism(populasi, n_fitness)
  while len(newpop) <= len(populasi):

    # PARENT SELECTION
    o1 = tournament(populasi, k_prob)
    o2 = tournament(populasi, k_prob)
    a1, a2 = o1.copy(), o2.copy()

    # CROSSOVER
    a1, a2 = crossover(a1, a2, probCrossover)

    # MUTASI
    a1 = mutasi(a1, probMutasi)
    a2 = mutasi(a2, probMutasi)
    newpop.append(a1)
    newpop.append(a2)
  populasi = newpop.copy()

  # MENGOUTPUTKAN POPULASI DAN NILAI FITNESS MASING - MASING GENERASI
  clear_output(wait=True)
  print("gen ",generasi+1)
  print(*zip(populasi,n_fitness),sep="\n")
 

# MENGOUTPUTKAN KROMOSOM TERBAIK
n = round(n_population/4)
best = list(zip(populasi[:n], n_fitness[:n]))
print("\n")
print("Result :")
print("Jumlah Populasi  : ", n_population)
print("Panjang Kromosom : ", indv)
print("Generasi ke - ", generasi+1)

print(*best, sep="\n")
print("\n")

print("kromosom terbaik : ", populasi[0], "\n")

print("fitness terbaik : ", n_fitness[0], "\n")

print("x1, x2 :",decode(populasi[0]))